import React from 'react';

function Cards() {

    const styles = {
        body: {
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            minHeight: "100vh",
            backgroundColor: "#111"
        }
    }

    return(
    <div className="body" style={styles.body}>
        <div className="container">
            <div className="card">
                <span></span>
                <div className="content">
                    <h2>Header Text</h2>
                    <p>Description or paragraph of the card.</p>
                    <a href="#">Read more</a>
                </div>
            </div>
        </div>
    </div>
    )
}

export default Cards;
